const ColorButton = withStyles((theme) => ({
    root: {
        color: theme.palette.getContrastText(purple[500]),
        backgroundColor: purple[500],
        '&:hover': {
            backgroundColor: purple[700],
        },
    },
}))(Button);

const useStyles = makeStyles((theme) => ({
    margin: {
        margin: theme.spacing(1),
    },
}));

const theme = createMuiTheme({
    palette: {
        primary: green,
    },
});

const Index = (props) => {
    const classes = useStyles();
    return <ThemeProvider theme={theme}><Button variant="contained" onClick={props.onClick} disabled={props.disabled ? "disabled" : ""} color="primary" className={props.className + " " + classes.margin}>{props.text}</Button></ThemeProvider>
}

export default Index;
